import { ImagesFiltersTypes } from "./types";

const baseUrl = "https://worldoftechnology.pythonanywhere.com/api";


const images = ({query, page, limit, category}:ImagesFiltersTypes): string => `${baseUrl}/images/?page=1&category=all&limit=50&query=&order=-id`;

export const Endpoints = {
    images,
}
